import React from 'react';

function Header() {
  return (
    <header className="container">
      <div className="bg-primary text-white text-center py-4 rounded shadow-sm mb-4">
        <h1 className="display-5 fw-bold mb-1">Estudio Comparativo: PostgreSQL vs MonetDB</h1>
        <p className="lead mb-0" style={{ maxWidth: 960, margin: '0 auto' }}>
          Visualización de resultados de pruebas analíticas en almacén de datos dimensional
        </p>
      </div>
    </header>
  );
}

export default Header;
